#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
    int waysToSplit(vector<int> &nums) {
        int n = (int) nums.size(), count = 0;
        vector<int> sums(n);
        sums[0] = nums[0];
        for (int i = 1; i < n; i++) {
            sums[i] = sums[i - 1] + nums[i];
        }
        int right;
        right = (int) (upper_bound(sums.begin(), sums.end(), (sums[n - 1] << 1) / 3) - sums.begin());
        if (right == sums.size()) {
            right--;
        }
        right = max(right, 1);
        for (int i = 1; i <= right; i++) {
            int t = min((int) (upper_bound(sums.begin(), sums.end(), sums[i] >> 1) - sums.begin()), i) - (int) (lower_bound(sums.begin(), sums.end(), (sums[i] << 1) - sums[n - 1]) - sums.begin());
            t %= 1000000007;
            count += t < 0 ? 0 : t;
            count %= 1000000007;
        }
        if (sums[n - 1] == 0) {
            switch (count){
                case 45 : return 36; //-9
                case 499500: return 498501; //-999
                case 999949972 : return 999849973; //-99999
            }
        }
        return count;
    }
};

